import React, { Component } from 'react';
import Card from './components/Card';

const firstCard = (
  <Card title='First Card' content='test'>
  test
  </Card>
);

class App extends Component {
  render() {
    return (
      <div>
        {firstCard}
        </div>
    );
  }
}

export default App;
